import React from "react";

function Header() {
  return (
    <header className="bg-blue-900 text-white p-4 flex items-center justify-between shadow-md">
      <div className="flex items-center space-x-3">
        <img
          src="/logo192.png"  // replace with your actual logo
          alt="Company Logo"
          className="w-10 h-10"
        />
        <h1 className="text-xl font-bold">Cold Company</h1>
      </div>
      <input
        type="text"
        placeholder="Search..."
        className="p-2 rounded text-black w-1/3"
      />
    </header>
  );
}

export default Header;
